import React from 'react';
import { Link } from 'react-router-dom';

export default function ErrorPage() {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>‚ùå Login Failed</h1>
      <p style={styles.message}>Incorrect username or password, or unauthorized access.</p>
      <Link to="/login" style={styles.link}>Back to Login</Link>
    </div>
  );
}

const styles = {
  container: {
    backgroundColor: '#1e1e2f',
    color: '#fff',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
  },
  heading: {
    fontSize: '36px',
    marginBottom: '20px',
    color: '#ff4d4d',
  },
  message: {
    fontSize: '18px',
    marginBottom: '20px',
  },
  link: {
    color: '#00fff7',
    fontWeight: 'bold',
    fontSize: '18px',
    textDecoration: 'underline',
  },
};
